import './App.css';
import Politics from "./PoliticsPage/Politics";
import store from "./store/store";
function App() {
  return (
    <div className="App">
        <Politics store={store}/>
        <button className={"end-turn"}>
            End Turn
        </button>
    </div>
  );
}

export default App;
